export async function getCategoriesFromDB() {
    let returnValue = ["empty"];

    fetch('http://127.0.0.1:8000/api/categories/')
        .then(res => res.json())
        .then((data) => {
            returnValue = data.categories;
        })
        .catch(console.log);

    return returnValue;
}
